import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Produkty from './components/Produkty/Produkty.js';
import Platnosci from './components/Platnosci/Platnosci.js';
import Koszyk from './components/Koszyk/Koszyk.js';
import { KoszykProvider } from './components/Koszyk/KoszykContext.js'; // Jeśli KoszykContext jest w folderze Koszyk

function App() {
    return (
        <KoszykProvider> {/* Obejmuje całą aplikację kontekstem koszyka */}
            <Router>
                <Routes>
                    <Route path="/" element={<Produkty />} />
                    <Route path="/platnosci" element={<Platnosci />} />
                    <Route path="/koszyk" element={<Koszyk />} />
                </Routes>
            </Router>
        </KoszykProvider>
    );
}

export default App;
